s:12:"premium_slug";s:30:"erc20-dividend-payment-premium";s:4:"type";s:6:"plugin";s:20:"affiliate_moderation";N;s:19:"is_wp_org_compliant";b:0;s:22:"premium_releases_count";i:2;s:4:"file";N;s:7:"version";N;s:11:"auto_update";N;s:4:"info";O:14:"FS_Plugin_Info":13:{s:2:"id";s:4:"1149";s:7:"updated";s:19:"2019-09-10 17:33:43";s:7:"created";s:19:"2019-09-10 16:47:20";s:22:"␀FS_Entity␀_is_updated";b:0;s:9:"plugin_id";s:4:"4564";s:11:"description";s:980:"<p>Administrator is able to create dividend payment tasks to pay dividends to token holders that hold their tokens on accounts created with the <a href="https://wordpress.org/plugins/ethereum-wallet/" target="_blank">Ethereum Wallet</a> plugin.</p>
<p>The <a href="https://wordpress.org/plugins/cryptocurrency-product-for-woocommerce/" target="_blank">Cryptocurrency Product for WooCommerce</a> plugin is also required. User needs to purchase some tokens with a help of this plugin to be eligible for the dividends payment procedure. The hot wallet configured for the <a href="https://wordpress.org/plugins/cryptocurrency-product-for-woocommerce/" target="_blank">Cryptocurrency Product for WooCommerce</a> plugin is used to send dividends from.</p>
<p>The <i>Token Address</i> and <i>Interest, %</i> fields needs to be configured in the payment task.</p>
