9;s third-party code and remove the ones\tthat aren&#039;t adding any value to your website.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/web.dev\/debounce-your-input-handlers\/\">Debouncing your input handlers<\/a><\/p>\n\t\t\t\t\t\t<p>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/p>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<p>Reducing JavaScript execution time<\/p>\n\t\t\t\t\t\t<p>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<p>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compos