roving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">Minify for CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Only using compositor properties<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>"}}},"desktop":{"score":21,"first-contentful-paint":{"score":0.03,"displayValue":"3.5\u00a0s"},"largest-contentful-paint":{"score":0.01,"displayValue":"8.0\u00a0s"},"interactive":{"score":0.02,"displayValue":"11.0\u00a0s"},"cumulative-layout-shift":{"score":0.81,"displayValue":"0.133"},"total-blocking-time":{"score":0.02,"displayValue":"1,250\u00a0ms"},"speed-index":{"score":0,"displayValue":"7.5\u00a0s"},"screenshots":{"final":{"title":"Final Screenshot","screenshot":"data:image\/jpeg;base64,\/9j\/4AAQSkZJRgABAQAAAQABAAD\/2wBDAAYEBQYFBAYGBQYHBwYIChAKCgkJChQODwwQFxQYGBcUFhYaHSUfGhsjHBYWICwgIyYnKSopGR8tMC0oMCUoKSj\/2wBDAQcHBwoIChMKChMoGhYaKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCj\/wAARCAFcAfQDASIAAhEBAxEB\/8QAHAAAAQUBAQEAAAAAAAAAAAAAAAMEBQYHAgEI\/8QAVBAAAgEDAgMFBAUHCQUECgIDAQIDAAQRBSEGEjETIkFRYRRxgZEHMqGx0QgVI0JSksEkM1VicpTS4fAWQ0RUghiTovEXNDVFU2NzdIOEJaOys8L\/xAAbAQADAQEBAQEAAAAAAAAAAAAAAgMBBAUGB\/\/EADERAAIBAgUEAQMDBAMBAQAAAAABAgMRBBI