ing"}],"type":["TBT"],"instructions":"<p>Optimizing third-party JavaScript<\/p>\n\t\t\t\t\t\t<p>Review your website&#039;s third-party code and remove the ones\tthat aren&#039;t adding any value to your website.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/web.dev\/debounce-your-input-handlers\/\">Debouncing your input handlers<\/a><\/p>\n\t\t\t\t\t\t<p>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/p>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<p>Reducing JavaScript execution time<\/p>\n\t\t\t\t\t\t<p>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<p>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/thinkincoin.com\/website\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/p>"},"third-party-summary":{"title":"Reduce the impact of third-party code","description":"Third-party code can significantly impact load performance. Limit the number of redundant third-party providers and try to load third-party code after your page has primarily finished loading. [Learn how to minimize third-party impact](https:\/\/developers.google.com\/web\/fundamentals\/performance\/optimizing-content-efficiency\/loading-third-party-javascript\/).","score":0,"displayValue":"Third-party code blocked the main thread for 2,970\u00a0ms","details":[{"blockingTime":2111.4449999999997,"subItems":{"items":[{"transferSize":188193,"mainThreadTime":1712.3539999999907,"blockingTime":1333.4789999999998,"url":"https:\/\/dexscreener.com\/assets\/chunks\/chunk-EIVMWWHW.js"},{"blockingTime":240.20999999999998,"url":"https:\/\/dexscreener.com\/tv\/v26.004\/bundles\/library.922da4a8fbaf39eb2333.js","mainThreadTime":339.17999999999967,"transferSize":626787},{"transferSize":58928,"mainThreadTime":515.4999999999991,"blockingTime":216.618,"url":"https:\/\/dexscreener.com\/harmony\/0x222F2BC1F40FF49F5539045b04c5e74A924b867D?embed=1&theme=dark&trades=0"},{"blockingTime":170.019,"url":"https:\/\/dexscreener.com\/assets\/chunks\/chunk-UGGOHSHP.js","transferSize":38858,"mainThreadTime":390.21899999999977},{"blockingTime":83.50999999999999,"url":"https:\/\/dexscreener.com\/tv\/v26.004\/bundles\/restricted-toolset.63a8261f0c902623b57f.js","mainThreadTime":146.88199999999938,"transferSize":26979},{"transferSize":998770,"url":"Other resources","blockingTime":67.60899999999992}],"type":"subitems"},"transferSize":1938515,"mainThreadTime":3611.5269999999887,"entity":"dexscreener.com"},{"entity":"YouTube","blockingTime":790.7,"transferSize":1066