ulate the aspect ratio for an image\/video based on the declared width and height attributes.<\/p>"},"viewport":{"title":"Has a `<meta name=\"viewport\">` tag with `width` or `initial-scale`","description":"A `<meta name=\"viewport\">` not only optimizes your app for mobile screen sizes, but also prevents [a 300 millisecond delay to user input](https:\/\/developer.chrome.com\/blog\/300ms-tap-delay-gone-away\/). [Learn more about using the viewport meta tag](https:\/\/developer.chrome.com\/docs\/lighthouse\/pwa\/viewport\/).","score":1,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<p>Use the &quot;viewport&quot; &lt;meta&gt; tag to control the viewport&#039;s size and shape form mobile friendly website:<\/p>\n\t\t\t\t\t\t<code>&lt;meta name=&quot;viewport&quot; content=&quot;width=device-width, initial-scale=1&quot;&gt;<\/code>\n\t\t\t\t\t\t<p>More details <a target=\"_blank\" href=\"https:\/\/developer.mozilla.org\/en-US\/docs\/Web\/HTML\/Viewport_meta_tag\">here<\/a>.<\/p>"}},"diagnostics":{"font-display":{"title":"Ensure text remains visible during webfont load","description":"Leverage the `font-display` CSS feature to ensure text is user-visible while webfonts are loading. [Learn more about `font-display`](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/font-display\/).","score":0,"displayValue":null,"details":[{"url":"https:\/\/fonts.gstatic.com\/s\/roboto\/v18\/KFOmCnqEu92Fr1Mu4mxKKTU1Kg.woff2","wastedMs":3.6350000500679016},{"url":"https:\/\/fonts.gstatic.com\/s\/roboto\/v18\/KFOlCnqEu92Fr1MmEU9fBBc4AMP6lQ.woff2","wastedMs":4.477999985218048}],"type":["FCP","LCP"],"instructions":"<p>It&#039;s advisable to host the fonts on the server instead of using Google CDN<\/p>\n\t\t\t\t\t\t<p>Preload fonts with a plugin or manually:<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<code>&lt;link rel=&quot;preload&quot; target=&quot;_blank&quot; href=&quot;\/webfontname&quot; as=&quot;font&quot; type=&quot;font\/format&quot; crossorigin&gt;<\/code>